eactiveFormsModule, // Formularios reactivos\n    ],\n\n    /**\n     * Exporta los componentes para que puedan ser utilizados en otros módulos.\n     */\n    exports: [\n        InicioComponent,\n        CatalogoComponent,\n        CestaComponent,\n        ContactoComponent,\n        ProductoComponent,\n        FormularioCestaComponent,\n    ], \n\n    /**\n     * Servicios disponibles en este módulo.\n     * En este caso, se exporta el servicio de productos.\n     */\n    providers: [ProductoServicio], \n    bootstrap: []\n})\nexport class PageModule {}\n\n    \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"components/ProductoComponent.html":{"url":"components/ProductoComponent.html","title":"component - ProductoComponent","body":"\n                   \n\n\n\n\n\n  Components\n  \n  ProductoComponent\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n        \n            Template\n        \n        \n            Styles\n        \n        \n            DOM Tree\n        \n\n\n\n    \n    File\n\n\n    src/app/pages/producto/producto.component.ts\n\n\n\n    \n        Description\n    \n    \n        Componente que muestra los detalles de un producto y permite agregarlo al carrito de compras.\n\n    \n\n\n\n\n\n    Metadata\n    \n        \n\n\n\n\n\n\n\n\n\n\n\n\n            \n                selector\n                app-producto\n            \n\n\n\n            \n                styleUrls\n                ./producto.component.css\n            \n\n\n\n            \n                templateUrl\n                ./producto.component.html\n            \n\n\n\n\n\n\n\n\n        \n    \n\n\n    \n    Index\n    \n        \n                \n                    \n                        Properties\n                    \n                \n                \n                    \n                        \n                    